//iiif.io/api/presentation/3/context.json","id":"https://api.dc.library.northwestern.edu/api/v2/works/513f420e-4ef6-4fa0-9174-2f5a6fcecca5?as=iiif","type":"Manifest","label":{"none":["NU vs. Miami/NU vs. NIU/NU vs. Minn (Pregame and Halftime)"]},"metadata":[{"label":{"none":["Alternate Title"]},"value":{"none":["Northwestern vs. Miami University, Northwestern vs. Northern Illinois, and Northwestern vs. Minnesota"]}},{"label":{"none":["Contributor"]},"value":{"none":["Paynter, John P. (Donor)","Northwestern University (Evanston, Ill.). Marching Band (Performer)","Northwestern University (Evanston, Ill.). School of Music (Contributor)","Northwestern University (Evanston, Ill.) (Contributor)","Northwestern University (Evanston, Ill.) (Contributor)","Friedmann, Pete (Contributor)","Lonis, Dale (Conductor)","Ward, Samuel A., 1847-1903 (Composer)","Williams, John, 1932- (Composer)","Paynter, John P. (Arranger)","Paynter, John P. (Conductor)","Tchaikovsky, Peter Ilich, 1840-1893 (Composer)","Owens, Don (Don D.) (Conductor)","Husky Marching Band (Performer)","Sousa, John Philip, 1854-1932 (Composer)","Earth, Wind & Fire (Musical group) (Contributor)","Rodgers, Richard, 1902-1979 (Composer)","Williams, Clifton, 1923-1976 (Composer)"]}},{"label":{"none":["Date"]},"value":{"none":["September 18, 1982","September 25, 1982","October 8, 1982"]}},{"label":{"none":["Department"]},"value":{"none":["University Archives"]}},{"label":{"none":["Genre"]},"value":{"none":["VHS"]}},{"label":{"none":["Last Modified"]},"value":{"none":["2024-07-31T17:56:28.664934Z"]}},{"label":{"none":["Language"]},"value":{"none":["English"]}},{"label":{"none":["Materials"]},"value":{"none":["videocassette (VHS)"]}},{"label":{"none":["Provenance"]},"value":{"none":["19/2/5 NU Band Program"]}},{"label":{"none":["Related URL"]},"value":{"none":["<span><a href=https://findingaids.library.northwestern.edu/repositories/6/resources/1939>Finding Aid</a></span>"]}},{"label":{"none":["Rights Statement"]},"value":{"none":["Copyright Not Evaluated"]}},{"label":{"none":["Series"]},"value":{"none":["Northwestern University Video Cassette Collection"]}},{"label":{"none":["Subject"]},"value":{"none":["Northwestern University (Evanston, Ill.). Marching Band","Northwestern University (Evanston, Ill.). School of Music","Music","Marching bands","Conductors (Music)","Band directors","Miami University (Oxford, Ohio)","Ryan Field (Evanston, Ill.)","Northern Illinois Huskies (Football team)","Northern Illinois University","Minnesota Golden Gophers (Football team)","University of Minnesota","Northwestern Wildcats (Football team)","Northwestern University (Evanston, Ill.)","America the beautiful (Ward, Samuel A.)","Raiders of the lost ark (Motion picture)","Tchaikovsky, Peter Ilich, 1840-1893. 1812","Dallas (Television program)","Sousa, John Philip, 1854-1932. Stars and stripes forever","Days of our lives (Television program)","Fame (Motion picture : 1980)"]}}],"summary":{"none":["Three performances by the Northwestern University Marching Band during the 1982 season. First, the Northwestern University Marching Band performs at the Northwestern Wildcats\' game against the Miami University RedHawks at Dyche Stadium in Evanston, Illinois. Pregame performances include \\"American the Beautiful.\\" Dale Lonis then conducts the National Anthem. \\"Miami March Song,\\" \\"Got to Get You Into My Life,\\" and \\"Go U Northwestern\\" are performed. High school marching bands from the Illinois and Wisconsin area join the Northwestern University Marching Band on the field for a halftime performance. The Lincoln-Way Community High School Band begins the halftime show with a performance. Former Wildcat coach Bob Voigts is honored as part of the celebration of 100 years of Northwestern Football. The Northwestern University Marching Band performs the theme from \\"Dallas.\\" The high school marching bands perform the theme from \\"Raiders of the Lost Ark.\\" John P. Paynter conducts his arrangement of the \\"1812 Overture,\\" and then Don Owens conducts \\"Alma Mater.\\" The second performance is from the Northwestern Wildcats\' game against the Northern Illinois Huskies at Dyche Stadium in Evanston, Illinois. The Marching Huskies Show Band begins the pregame show with performances of \\"Stars and Stripes Forever\\" and \\"NIU Fight Song.\\" The Northwestern University Marching Band\'s pregame performances include \\"American the Beautiful,\\" the National Anthem, \\"NIU Fight Song,\\" \\"Got to Get You Into My Life,\\" and \\"Go U Northwestern.\\" The Marching Huskies begin the halftime show with performances of \\"Slaughter on 10th Avenue,\\" \\"In the Stone,\\" and \\"In the Mood.\\" The Northwestern University Marching Band performs the theme music from \\"Dallas\\" and \\"Days of Our Lives,\\" music from \\"Fame,\\" and \\"Alma Mater.\\" Fans took to the field after the game to celebrate the Northwestern Wildcats\' first victory in 34 games. Postgame performances by the Northwestern University Marching Band and the Marching Huskies include \\"Go U Northwestern,\\" \\"NIU Fight Song,\\" \\"In the Mood,\\" \\"Bill Bailey Won\'t You Please Come Home,\\" \\"In the Stone,\\" \\"Get It On,\\" and \\"Alma Mater.\\" The third performance is from the Northwestern Wildcats\' game against the Minnesota Gophers at Dyche Stadium in Evanston, Illinois. The pregame performance begins with \\"America the Beautiful.\\" Don Owens then conducts the National Anthem. The pregame show continues with \\"Minnesota Rouser,\\" \\"Sinfonians,\\" and \\"Go U Northwestern.\\""]},"requiredStatement":{"label":{"none":["Attribution"]},"value":{"none":["Courtesy of Northwestern University Libraries","The recordings on this web site are provided for use by Northwestern University students, faculty, staff and guests. Further distribution and/or any commercial use of these recordings from this site is strictly prohibited. Please contact specialcollections@northwestern.edu for more information"]}},"r